async function () {
  await Api1.run();
  let transformed = {};
  let seriesData = [];
  if (Api1.data.success) {
    Api1.data.data.forEach(item => {
      let dataObject = {};
      dataObject['x'] = new Date(item.timestamp).toLocaleTimeString();
      dataObject['y'] = item.people;
      seriesData.push(dataObject);
      for (const key in item) {
        if (!transformed[key]) {
          transformed[key] = [];
        }
        transformed[key].push(item[key]);
      }
    });
  }
  seriesData.reverse();
  storeValue('people', seriesData);
  storeValue('data', transformed);
  setInterval(10000);
}

